CREATE TABLE COMPONENTS (CNAME VARCHAR2(64),PARENT_CNAME VARCHAR2(64), TORDER NUMBER, PNAME VARCHAR2(64), PTYPE VARCHAR2(64), PROPTYPE VARCHAR2(64), PROPDEFAULT VARCHAR2(64), PSCOPE VARCHAR2(64));

TRUNCATE TABLE COMPONENTS;


COMMIT;
ALTER TABLE components ADD (gflag varchar2(1));

SELECT * FROM components;
SELECT count(*) FROM components;
SELECT * FROM components ORDER BY cname,ptype,pname;
SELECT * FROM components WHERE REGEXP_LIKE(ptype,'property','i')  ORDER BY cname,ptype,pname,torder ;
SELECT cname,pname FROM components WHERE REGEXP_LIKE(ptype,'property','i')  GROUP BY cname,pname HAVING count(*) > 1 ORDER BY cname,pname;
